      ]}
    >
      <div style={{ textAlign: 'center' }}>
      <Card.Meta avatar={<Avatar>ZC</Avatar>} title="devZucca"></Card.Meta>
      <Button onClick={onLogOut}>로그아웃</Button>
      </div>
    </Card>
  );
};

export default UserProfile;
